{"title":"Resilmesh-Nodes _connections","type":"vega","aggs":[],"params":{"spec":"{
  "$schema": "https://vega.github.io/schema/vega/v5.json",
  "width": 700,
  "height": 300,
  "autosize": "none",

  "signals": [
    { "name": "cx", "update": "width / 2" },
    { "name": "cy", "update": "height / 2" },
    { "name": "nodeRadius", "value": 15, "bind": { "input": "range", "min": 10, "max": 50, "step": 1 } },
    { "name": "linkDistance", "value": 30, "bind": { "input": "range", "min": 5, "max": 100, "step": 1 } },
    { "name": "nodeCharge", "value": -30, "bind": { "input": "range", "min": -100, "max": 10, "step": 1 } },

    // Add a checkbox to toggle static positions
    { 
      "name": "isStatic", 
      "value": false, 
      "bind": { "input": "checkbox", "name": "Static Nodes: " }
    },

    // Signals for dragging
    {
      "name": "activeNode", "value": null,
      "on": [
        { "events": "symbol:mousedown", "update": "isStatic ? null : item()" },
        { "events": "window:mouseup", "update": "null" }
      ]
    },
    {
      "name": "currentX", "value": null,
      "on": [
        { "events": "window:mousemove", "update": "activeNode ? x() : currentX" }
      ]
    },
    {
      "name": "currentY", "value": null,
      "on": [
        { "events": "window:mousemove", "update": "activeNode ? y() : currentY" }
      ]
    },

    // Update node positions after dragging
    {
      "name": "updateNodeCoords",
      "on": [
        {
          "events": "window:mouseup",
          "update": "activeNode ? modify('nodes', 'x', currentX, 'id', activeNode.datum.id) : null"
        },
        {
          "events": "window:mouseup",
          "update": "activeNode ? modify('nodes', 'y', currentY, 'id', activeNode.datum.id) : null"
        }
      ]
    },

    // Fix node position (fx and fy) after dragging
    {
      "name": "fixNodeCoords",
      "on": [
        {
          "events": "window:mouseup",
          "update": "activeNode ? modify('nodes', 'fx', currentX, 'id', activeNode.datum.id) : null"
        },
        {
          "events": "window:mouseup",
          "update": "activeNode ? modify('nodes', 'fy', currentY, 'id', activeNode.datum.id) : null"
        }
      ]
    }
  ],

  "data": [
    {
      "name": "raw_data",
      "url": {
        "index": "node-graph",
        "body": {
          "query": { "match_all": {} },
          "size": 10000
        }
      },
      "format": { "type": "json", "property": "hits.hits" }
    },
    {
      "name": "ranked_data",
      "source": "raw_data",
      "transform": [
        { "type": "window", "ops": ["row_number"], "as": ["rank"] }
      ]
    },
    {
      "name": "all_nodes",
      "source": "ranked_data",
      "transform": [
        { "type": "formula", "as": "id", "expr": "datum._source.id" },
        { "type": "flatten", "fields": ["_source.is_connected_to"], "as": ["connected_to"], "recurse": true },
        { "type": "flatten", "fields": ["_source.has_assigned"], "as": ["assigned_info"] },
        { "type": "flatten", "fields": ["assigned_info.resolves_to"], "as": ["domain_info"] },
        { "type": "formula", "as": "ip_address", "expr": "datum.assigned_info && datum.assigned_info.address ? datum.assigned_info.address : 'N/A'" },
        { "type": "formula", "as": "domain_name", "expr": "datum.domain_info && datum.domain_info.domain_name ? (isArray(datum.domain_info.domain_name) ? datum.domain_info.domain_name[0] : datum.domain_info.domain_name) : 'N/A'" }
      ]
    },
    {
      "name": "nodes",
      "source": "all_nodes",
      "transform": [
        { "type": "identifier", "as": "index" },
        {
          "type": "aggregate",
          "groupby": ["id", "ip_address", "domain_name"],
          "ops": ["count"],
          "fields": ["connected_to"],
          "as": ["connection_count"]
        },
        {
          "type": "formula",
          "as": "x",
          "expr": "random() * width"
        },
        {
          "type": "formula",
          "as": "y",
          "expr": "random() * height"
        }
      ]
    },
    {
      "name": "links",
      "source": "all_nodes",
      "transform": [
        { "type": "filter", "expr": "datum.connected_to != null && datum.connected_to._id != null" },
        { "type": "formula", "as": "source", "expr": "datum.id" },
        { "type": "formula", "as": "target", "expr": "datum.connected_to._id" },
        { "type": "lookup", "from": "nodes", "key": "id", "fields": ["source"], "as": ["source_node"] },
        { "type": "lookup", "from": "nodes", "key": "id", "fields": ["target"], "as": ["target_node"] },
        { "type": "filter", "expr": "datum.source_node != null && datum.target_node != null" }
      ]
    }
  ],

  "scales": [
    {
      "name": "color",
      "type": "ordinal",
      "domain": { "data": "nodes", "field": "id" },
      "range": { "scheme": "category20c" }
    }
  ],

  "marks": [
    {
      "name": "nodes-symbol",
      "type": "symbol",
      "zindex": 2,
      "from": { "data": "nodes" },
      "encode": {
        "enter": {
          "fill": { "scale": "color", "field": "id" },
          "stroke": { "value": "white" }
        },
        "update": {
          "size": { "signal": "2 * nodeRadius * nodeRadius" },
          "x": { "signal": "activeNode && activeNode.datum.id == datum.id ? currentX : datum.fx != null ? datum.fx : datum.x" },
          "y": { "signal": "activeNode && activeNode.datum.id == datum.id ? currentY : datum.fy != null ? datum.fy : datum.y" },
          "cursor": { "value": "pointer" },
          "tooltip": {
            "signal": "'ID: ' + datum.id + '\\nIP: ' + datum.ip_address + '\\nDomains: ' + (datum.domain_name ? datum.domain_name : 'N/A') + '\\nConnections: ' + datum.connection_count"
          }
        }
      }
    },
    {
      "type": "path",
      "from": { "data": "links" },
      "encode": {
        "enter": {
          "stroke": { "value": "#ccc" },
          "strokeWidth": { "value": 1 }
        },
        "update": {
          "strokeWidth": {
            "signal": "activeNode && (datum.source_node.id == activeNode.datum.id || datum.target_node.id == activeNode.datum.id) ? 3 : 1" // Bold links during drag
          },
          "path": {
            "signal": "datum.source_node && datum.target_node && isNumber(currentX) && isNumber(currentY) ? 'M' + (activeNode && activeNode.datum && datum.source_node.id == activeNode.datum.id ? currentX : datum.source_node.fx != null ? datum.source_node.fx : datum.source_node.x) + ',' + (activeNode && activeNode.datum && datum.source_node.id == activeNode.datum.id ? currentY : datum.source_node.fy != null ? datum.source_node.fy : datum.source_node.y) + 'L' + (activeNode && activeNode.datum && datum.target_node.id == activeNode.datum.id ? currentX : datum.target_node.fx != null ? datum.target_node.fx : datum.target_node.x) + ',' + (activeNode && activeNode.datum && datum.target_node.id == activeNode.datum.id ? currentY : datum.target_node.fy != null ? datum.target_node.fy : datum.target_node.y) : ''"
          }
        }
      }
    }
  ]
}












































































































































































































"}}
